import React from 'react';
import './App.css';
import HeadTitle from './HeadTitle';
import Product from './Product';

function App() {
  return (
    <div >
      <HeadTitle></HeadTitle>
      <div classNam="container">
          <div class="row">
              <div class="col-4">
              <Product></Product>
              </div>
          </div>
      </div>
    </div>
  );
}

export default App;
